import React, { Component } from 'react';
import { Header , Container } from 'semantic-ui-react';
export default class ProductList extends Component {
    render() {
        return (
            <div>
                <React.Fragment>
                    ProductList
                    <Container>
            <Header size='large'>Mobile Products</Header>
        </Container>
                </React.Fragment>
            </div>
        )
    }
}
